import React from "react"
import { Row, Col } from "react-bootstrap"

const CollectionOne = () => {
  const datas = [];

  for (let i = 1; i <= 4; i++) {
    let data = {};
    data.class = "collection-one-content";
    data.image = `/image/CollectionOne/CollectionOne_${i}.jpg`;

    datas.push(data);
  }

  return (
    <Row className="row-section collection-section collection-one-section">
      {datas.map((data, i) => {
        return <Col as="a" className={data.class} style={{"backgroundImage": data.image}}></Col>
      })}
    </Row>
  )
}

export default CollectionOne
